import React from 'react';
import { useParams } from 'react-router';
import './ArticlePage.css'

function ArticlePage(props) {
    const { name } = useParams();

    return(
        <div >
            <h1> This is an {name} Article </h1>
        </div>
    );   
}

export default ArticlePage;
